import "./App.css";
import Contact from "./components/Contact";
import EmbeddedMap from './components/EmbeddedMap'; 
import {
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBCardImage,
  MDBBtn
} from 'mdb-react-ui-kit';

function App() {
  return (
    <div className="App">
      <Contact />

      <EmbeddedMap />

      <MDBCard />
    </div>
  );
}

export default App;
